import './styles/styles.css';
const Footer = () => {
    return (
        <footer className="footer-component row w-100 align-items-end">
            <div className="col d-flex justify-content-center align-items-center"><div class="copyright">&copy; Copyright <strong>Digital Mountain</strong>. All Rights Reserved</div></div>            
        </footer>
        )
}
export default Footer;
